import React, { useEffect, useRef, useState } from 'react';
import { makeStyles, useTheme } from '@mui/styles';
import { styled, alpha } from '@mui/material/styles';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import CancelIcon from '@mui/icons-material/Cancel';
import { Grid, IconButton, Typography } from '@mui/material';

const useStyles = makeStyles(theme => ({
    px2: {
        paddingLeft: '1.5rem',
        paddingRight: '1.5rem'
    },
    py1: {
        paddingBottom: '1rem',
        paddingTop: '1rem',
        borderBottom: `1px solid ${theme.palette.background.midGrey}`
    },
    mt1mb8: {
        marginTop: '0.5rem',
        paddingBottom: `${theme.spacing(7)} !important`
    }
}));

function SearchList({ list, search, fullScreen=false }) {
    const classes = useStyles();
    const location = useLocation();
    const navigate = useNavigate();

    const renderRow = searchItem => {
        return (
            <Grid container onClick={() => search(searchItem)} justifyContent="space-between" alignItems="center" className={classes.py1}>
                <Grid item xs={10} className={classes.px2}>
                    <Typography color="textSecondary">
                        {searchItem}
                    </Typography>
                </Grid>
            </Grid>
        )
    };

    console.log(list[166]);

    return (
        <Grid container justifyContent="flex-start" alignItems="center" className={classes.mt1mb8}>
            {list.map(item => renderRow(item))}
        </Grid>
    );
}

export default SearchList;
